import { useState } from "react"
import React from 'react'
import Todo from './Todo'
import ReactDom from 'react-dom';
import SkipNextRounded from '@material-ui/icons/SkipNextRounded';
export default function Form() {

    const [inputs, setName] = useState({
        firstname: "",
        email: "",

    })


  const goTodo = () => {
        console.log('Routed')
        ReactDom.render(
            <>
                <Todo />
            </>,
            document.getElementById('root')
        );
    }
    const Copytext = (event) => {
        const { name, value } = event.target
        /*console.log(name, value)*/


        setName((preValue) => {
            /*console.log(preValue)*/
            return {
                ...preValue,
                [name]: value,

            }
        })
    if (inputs.firstname === 'Ajay' && inputs.email === 'ajay') {
        console.log('Ok')
        return(<button className='add' id='button' onClick={goTodo}><SkipNextRounded /></button>)

    }
    else {
        console.log('Not ok')
    }

    }


    /*console.log('inputs2f=' + inputs.firstname + '|inputs2e=' + inputs.email)*/


    /*const Check = () => {
       
    }*/

  
    return (
        <>
            <div>
                <h1>Hello  {inputs.firstname} {inputs.lastname}</h1>
                <h4>{inputs.email}</h4>
                <div className='container'>
                    <input value={inputs.firstname} name='firstname' onChange={Copytext} className='form-control form-control-lg' placeholder='Enter Firstname' />
                    <br /><br />

                    <input value={inputs.email} name='email' onChange={Copytext} className='form-control form-control-lg' placeholder='Email' />
                    <br /><br />

                </div>
                
            </div>
        </>
    )
}
